import { Component } from '@angular/core';
import { AuthService } from '../services/auth.service';
import { ToastController } from '@ionic/angular';
import { Router } from '@angular/router';  // Importa el Router

@Component({
  selector: 'app-login',
  templateUrl: './login.page.html',
  styleUrls: ['./login.page.scss'],
})
export class LoginPage {
  email: string = '';
  password: string = '';
  passwordFieldType: string = 'password'; // Usamos passwordFieldType para controlar la visibilidad
  passwordToggleIcon: string = 'eye-off'; // Usamos passwordToggleIcon para el ícono

  // Inyecta el AuthService y Router
  constructor(
    public authService: AuthService,
    public toastController: ToastController,
    private router: Router  // Agrega Router al constructor
  ) {}

  ngOnInit() {
    // Redirige si hay una sesión activa
    if (this.authService.isLoggedIn) {  // Sin paréntesis
      this.router.navigate(['/inicio']);
    }
  }

  // Método para manejar el inicio de sesión
  async onSubmit() {
    if (!this.email || !this.password) {
      this.presentToast('Por favor, complete ambos campos.', 'danger');
      return;
    }

    try {
      await this.authService.signIn(this.email, this.password);
      this.presentToast('¡Inicio de sesión exitoso!', 'success');
      
      // Redirige a la página de inicio después del login exitoso
      this.router.navigate(['/inicio']);  // Usa router para redirigir

      // Limpiar campos de formulario
      this.email = '';
      this.password = '';
    } catch (error: any) {
      this.presentToast('Error al iniciar sesión: ' + error.message, 'danger');
    }
  }

  // Método para alternar la visibilidad de la contraseña
  togglePasswordVisibility() { 
    this.passwordFieldType = this.passwordFieldType === 'password' ? 'text' : 'password';
    this.passwordToggleIcon = this.passwordToggleIcon === 'eye-off' ? 'eye' : 'eye-off';
  }

  // Método para mostrar un mensaje toast
  async presentToast(message: string, color: string) {
    const toast = await this.toastController.create({
      message,
      color,
      duration: 2000,
      position: 'top'
    });
    await toast.present();
  }
}
<ion-header>
  <ion-toolbar color="dark">
    <ion-title class="ion-text-center">Iniciar Sesión</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true" class="ion-padding ion-text-center dark-theme background">
  <div class="logo-container">
    <img src="../../../assets/img/logo.png" class="logo">
  </div>

  <form (ngSubmit)="onSubmit()">
    <!-- Campo de Correo Electrónico -->
    <ion-item class="dark-item">
      <ion-label position="stacked" class="ion-text-center">Correo Electrónico</ion-label>
      <ion-input 
        type="email" 
        [(ngModel)]="email" 
        placeholder="Escribe aquí..." 
        name="email" 
        required>
      </ion-input> 
    </ion-item>

    <!-- Campo de Contraseña -->
    <ion-item class="dark-item">
      <ion-label position="stacked" class="ion-text-center">Contraseña</ion-label>
      <ion-input 
        [type]="passwordFieldType"
        [(ngModel)]="password" 
        name="password" 
        required >
      </ion-input>  
      <ion-button 
        fill="clear" 
        slot="end" 
        (click)="togglePasswordVisibility()" 
        title="Mostrar/Ocultar contraseña" 
        aria-label="Mostrar u ocultar contraseña">
        <ion-icon [name]="passwordToggleIcon"></ion-icon> 
      </ion-button>
    </ion-item>

    <br>
    <!-- Botón de Iniciar Sesión -->
    <ion-button expand="block" type="submit" class="login-button">Iniciar Sesión</ion-button>
  </form>
</ion-content>
